import React from 'react';
import Form from './components/Formulario';

function App() {

  const onSubmit = (data) => {
    alert('onSubmit de App perro');
    console.log(data);
    for(const key in data){
      console.log(`{key}: ${data[key]}`)
    }
  }

  return (
    <div className="container mt-4">
      <Form onSubmit={onSubmit}/>
    </div>
  );
}

export default App;
